Julia is a commander pilot who is briefing Johnny, a rookie pilot, on his new mission. She notices that Johnny looks extremely nervous because he's not ready yet to go out on a mission. As she's talking to him, she notices that he's calmer when he looks at her tits. She walks around and seduces him so that he's relaxed and ready to go.
